// JavaScript should be made compatible with libraries other than jQuery by
// wrapping it with an "anonymous closure". See:
// - https://drupal.org/node/1446420
// - http://www.adequatelygood.com/2010/3/JavaScript-Module-Pattern-In-Depth

(function ($, Drupal, window, document, undefined) {

	
// To understand behaviors, see https://drupal.org/node/756722#behaviors
Drupal.behaviors.ca_web = {
  attach: function(context, settings) {  
	  
				  //window definitions
				  $(window)
		    		.load( function() {
		    			// caro init
		    			$('#caro-lifestyle-risk').everslider({
		    					mode: 'carousel',
		    					itemKeepRatio: false,
		    					navigation: false,
		    					mouseWheel: true,
		    					pagination: false,
		    					syncHeight: false
		    				});
		    			 
		    			//caro navigation elements
		    			$('#lifestyle-risk .caro-sml-prev').click(function(){
		    				$(this).siblings('#caro-lifestyle-risk').trigger("everslider", "slidePrevious");
		    				return false;
		    			 });
		    			$('#lifestyle-risk .caro-sml-next').click(function(){		
		    				$(this).siblings('#caro-lifestyle-risk').trigger("everslider", "slideNext");
		    				return false;
		    			 });		
		    			
		    			var orig_colr = '#50baab';
		    			
		    			$(".hlr-card").hover(function(){
		    			   orig_colr = $(this).css("background-color");		    			   
		    			   $(this).css("background-color", '#ffc31d'); 
		    			    }, function(){
		    			    $(this).css("background-color", orig_colr);
		    			}); 
		    			
		    			
		    			
		    		})
		    		.resize( function() {		    			
		    			$(window).trigger('smartresize');	
		    		})
		    		.smartresize(function(){
			 			//equal col height
			 			eqCol('#caro-lifestyle-risk .card');
			 			eqCol('#caro-lifestyle-risk .card h3');
			 		  
					});
							  
				  // Aux functions
				  function eqCol(elems) {
						
						$(elems).css('min-height','auto');
						
					
						if ($(window).width() >= 768)
						{
							maxcol = 0;
							$(elems).each(function(index, value) {			
								
								//alert( index + ": " + value );
								
								if ($(this).height() >= maxcol)
								{
									maxcol = $(this).height();						
								}
							});
							
							$(elems).css('min-height',maxcol);
						}
					}
				//Bootstrap v3.0.0 - Windows Phone 8 and Internet Explorer 10 media query bug fix
				  if (navigator.userAgent.match(/IEMobile\/10\.0/)) {
					  var msViewportStyle = document.createElement("style");
					  msViewportStyle.appendChild(
					    document.createTextNode(
					      "@-ms-viewport{width:auto!important}"
					    )
					  );
					  document.getElementsByTagName("head")[0].appendChild(msViewportStyle);
					}
		}
	  };
})(jQuery, Drupal, this, this.document);
;
